public class P1Q2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int n = 10;
        for(int i = 0; i<n-1; i++){
            for(int j = 1; j<=n; j++){
                System.out.print(i+j +" ");
            }
            System.out.println();
        }
	}

}
